const axios = require('axios');

function ClientTrackerChart(props) {
    const [trackStats, setTrackStats] = useState([]);

    useEffect((props) => {

        //We call the api
        axios.get(`http://localhost:8011/client-tracker/tracks-stats/${props.clientId}`, {
            headers: {
            }
        }
        ).then(function (response) {

            setTrackStats(response.data);

        }).catch(function (error) {
                // handle error

        }).finally(function () {
                // always executed
        });

    }, []);


    return (
        <>
            <div class='container'>

               hola {props.clientId}

               {JSON.stringify(trackStats)}

            </div>
        </>
    );
}

export default ClientTrackerChart;
